import React from 'react';
import {List, ListItem, ListItemText} from '@material-ui/core';

const Uebersicht = (props) => {
    return(
        <List>
            {props.cocktails.map(value => {
                return(<ListItem>
                    <ListItemText primary={value}/>
                </ListItem>)
            })}
        </List>
        )
}
export default Uebersicht;
